import React, { Component } from 'react'; // import the React library
import './index.css';

const Title = (props) => (

    <ul>
        {   
            props.its.map((el,index)=>(
                    <li onClick={()=>props.delItem(index)}> {el} </li>
                )
            )
        }
    </ul>

)
export default Title;
